                    // 修复记忆的组件不验证
                    data.validate();
                    if (!data.isValid()) {
                        return false;
                    }

                    //获取防伪标记
                    var token = $('[name=__RequestVerificationToken]').val();
                    $.ajax({
                        url: ""/System/Account/Login"",
                        type: ""Post"",
                        datatype: ""json"",
                        cache: false,
                        data: {
