                        },
                        success: function (data) {
                            if (data.code == 200)
                                window.location.href = ""/System/Home/Index"";
                            else {
                                alert(data.msg);
                            }
                        }
                    });
                }
            });

            $(document).keyup(function (event) {
                if (event.keyCode === 13) {
                    $(""#btnSubmit"").click();
                }
            });
        });


